import React, { Fragment } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { routes } from './routes';
import { Header } from './components/Header/Header';

const App = () => {
  return (
    <Fragment>
      <Router>
        <Header />
        <Switch>
          {routes.map(route => {
            const Component = route.component;
            return (
              <Route
                key={route.path}
                path={route.path}
                exact={route.exact}
                component={<Component />}
              />
            );
          })}
        </Switch>
      </Router>
    </Fragment>
  )
}

export default App;
